import React from 'react';
import '../css/Home.css';
const Home = () => {
  const header = `Hi, my name is`;
  const name = `Steven Yoh`
  const introduction = `I'm a web developer with a passion for front end development and design. I aspire toward a career that will allow me to channel my creativity through crafting beautiful software and engaging experiences.`;
  return (
    <div className="home">
      <svg width="1440" height="900" viewBox="0 0 1440 900" fill="none" xmlns="http://www.w3.org/2000/svg">
        <g id="blob">
          <path id="blob-background" d="M702.884 101.574C1034.17 83.4912 1302.84 203.364 1319.07 368.158C1340.24 583.062 1114.75 877.749 735.56 700.224C443.367 563.427 128.394 598.953 119.371 433.64C110.348 268.327 371.595 119.656 702.884 101.574Z" fill="#7067FA" fill-opacity="0.8"/>
        </g>
      </svg>
      <div className="home-details">
        <p>Hello</p>
        <p>Im</p>
        <p>Im Steven</p>
        <p>A</p>
        <p>Fullstack</p>
        <p>Web Developer</p>
      </div>
    </div>
  )
}

export default Home;
